export const actionTypes = {
    GET_ACTIVE_EXAM_REQUEST: 'GET_ACTIVE_EXAM_REQUEST',
    GET_ACTIVE_EXAM_SUCCESS: 'GET_ACTIVE_EXAM_SUCCESS',
    GET_INACTIVE_EXAM_REQUEST: 'GET_INACTIVE_EXAM_REQUEST',
    GET_INACTIVE_EXAM_SUCCESS: 'GET_INACTIVE_EXAM_SUCCESS',
};

export function getActiveExams(payload) {
    return { type: actionTypes.GET_ACTIVE_EXAM_REQUEST, payload };
}

export function getActiveExamsSuccess(payload) {
    return { type: actionTypes.GET_ACTIVE_EXAM_SUCCESS, payload };
}

export function getInactiveExams(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAM_REQUEST, payload };
}

export function getInactiveExamsSuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAM_SUCCESS, payload };
}
